// GenderDropdown.js

import React from 'react';
import { GenderOption } from './menus/options'; // Importing GenderOption from options.js
import './DropdownStyles.css'

const GenderDropdown = ({ onSelectGender }) => {
  return (
    <select onChange={(e) => onSelectGender(e.target.value)}>
      {GenderOption.map((gender) => (
        <option key={gender} value={gender}>
          {gender}
        </option>
      ))}
    </select>
  );
};

export default GenderDropdown;
